import React, { useState, useEffect } from 'react';


const searchRedirect= () => {


    useEffect(() =>{
        console.log('Will redirect');
        FB.login(function(response){
            // handle the response 
            console.log('logged in via facebook')
          });


    })

    return(
        <h2>Redirecting...</h2>
    )

}

export default searchRedirect;
